def is_a(s: str):
    """
    Determines if a string is 'a'.
    :param s: The string to check.
    :return: True if the string is 'a', False otherwise.
    """
    return s == "a"

def is_a_ignore_case(s: str):
    """
    Determines if a string is 'a' ignoring case.
    :param s: The string to check.
    :return: True if the string is a, False otherwise.
    """
    return s.lower() == "a"

