def is_custom_str(s: str, custom_str: str):
    """
    Determines if a string is a custom string.
    :param s: The string to check.
    :param custom_str: The custom string to check against.
    :return: True if the string is a custom string, False otherwise.
    """
    return s == custom_str

def is_custom_str_ignore_case(s: str, custom_str: str):
    """
    Determines if a string is a custom string, ignoring case.
    :param s: The string to check.
    :param custom_str: The custom string to check against.
    :return: True if the string is a custom string, False otherwise.
    """
    return s.lower() == custom_str.lower()
